export default class List {
    constructor(){
       
    const cars = [
        {id: 1, brand: 'Ford'},
        {id: 2, brand: 'BMW'},
        {id: 3, brand: 'Audi'}
    ]
    }
  render() {
    return (
      <div>{cars}</div>
    )
  }
}
